export class MapContainer extends MapContainer {
  render() {
    return <Map></Map>;
  }
}

export default GoogleApiWrapper({
  apiKey: "AIzaSyCjTFsXFd7xWxDOPFDuf00smV8CUCgmpHE",
})(MapContainer);
